import React from 'react';

import './menuSetting.css';

const MenuSetting = (props) => {
    document.body.style.overflowY = 'hidden';
  return (
    <div className="menuSetting" onClick={() => props.show(false)}>
      <p>Setting</p>
    </div>
  );
};

export default MenuSetting;
